import React from 'react'


import Card from './Card'
import Sdata from './Sdata'
const favseries = 'Netflix'
const Favs = () => {
    if (favseries == 'Netflix') {
        return (
            <Card key={Sdata[0].id} imgsrc={Sdata[0].imgsrc} title={Sdata[0].title} fname={Sdata[0].fname} olink={Sdata[0].olink} />
        )
    }
}
const App = () => {
    return (
        <>
            <h1 style={{ textAlign: "center", margin: "20px 0 20px 0", letterSpacing: "0.5px" }}>List of Netflix Series</h1>
            {
                Sdata.map((val, i, Sdaa) => {
                    return (
                        <Card key={val.id} imgsrc={val.imgsrc}
                            title={val.title}
                            fname={val.fname}
                            olink={val.olink}
                        />)
                })
            }
        </>
    )
}
export default App;
